pragma solidity ^0.8.7;
import {hasBit,flipBit} from "../util/BitMap.sol";

struct Action {
    address to;
    uint256 value;
    bytes data;
}

contract baseproposal {

    
    enum ProposalStatus {
        InProgress,       // Proposal is still in progress.
        Approved,         // If quorum voted yes, this proposal is successfully approved.
        Rejected,         // If quorum voted no, this proposal is rejected. Bond is returned.
        Removed,          // If quorum voted to remove (e.g. spam), this proposal is rejected and bond is not returned.
        Expired,          // Expired after period of time.
        Moved,            // If proposal was moved to Hub or somewhere else.
        Failed            // If proposal has failed when finalizing. Allowed to re-finalize again to either expire or approve.
    }

    enum ProposalKind {
        FunctionCall, // 调用函数功能
        MintToken, // 铸造代币
        Transfer
    }

    struct voted {
        uint8 approval;
        uint8 reject;
        uint8 abstain;
    }
    error ActionFailed(uint256 index);
    error InsufficientGas();

    address public creator;
    string public name;
    string public discription;
    uint public startTime;
    uint public endTime;
    uint256 public voteCounts;
    Action[] actions;
    uint256 allowFailureMap;
    ProposalStatus proposalStatus;
    ProposalKind proposalKind;
    mapping(address => voted) public vote;

    event Executed(
        address actor,
        Action[] actions,
        uint256 allowFailureMap,
        uint256 failureMap,
        bytes[] execResults
    );

    constructor(
        string memory _name, 
        string memory _discription,
        uint8 _proposalKind,
        uint8 _proposalStatus,
        uint _startTime,
        uint _endTime
        ){

        creator = msg.sender;
        name = _name;
        discription = _discription;
        proposalKind = ProposalKind(_proposalKind);
        proposalStatus = ProposalStatus(_proposalStatus);
        startTime = _startTime;
        endTime = _endTime;
        allowFailureMap = 0xFFFFFFFF;
    }

    function setname(string memory _name) public{
        name = _name;
    }

    function setdiscription(string memory _discription) public{
        discription = _discription;
    }

    function setproposalKind(ProposalKind _proposalKind) public{
        proposalKind = _proposalKind;
    }

    function setproposalStatus(ProposalStatus _proposalStatus) public{
        proposalStatus = _proposalStatus;
    }

    function setvoteCounts(uint256 _voteCounts) public{
            voteCounts = _voteCounts;
    }
    function getvoteCounts() public view returns(uint256){
            return voteCounts;
    }

    function addactions(Action memory _action) public{
            actions.push(_action);
    }
    
    function setvote(address now_address, uint8 _approval, uint8 _reject, uint8 _abstain) public{
            vote[now_address].approval = _approval;
            vote[now_address].reject = _reject;
            vote[now_address].abstain = _abstain;
    }

    // function setAction_Transer(
    //     address reciver, 
    //     uint256 amount // abi encode 编码
    //     ) public{
    //         require(address(this).balance >= amount, "Insufficient contract balance");
    //         (bool success, ) = reciver.call{value: amount}("");
    //         require(success, "Transfer failed");
    // }

    function setAction(
        address fuction_address, 
        uint256 money,
        bytes memory _data // abi encode 编码
        ) public{
            Action memory action = Action({
                to: fuction_address,
                value: money,
                data: _data
            });
            actions.push(action);
    }

    // function execute(Action[] memory _actions, uint256 _allowFailureMap) public returns(bytes[] memory execResults, uint256 failureMap){

    //     execResults = new bytes[](_actions.length);
    //     uint256 gasBefore;
    //     uint256 gasAfter;

    //     for(uint i = 0; i < _actions.length; i++){

    //         gasBefore = gasleft();

    //         (bool success, bytes memory result) = _actions[i].to.call{value: _actions[i].value}(
    //             _actions[i].data
    //         );

    //         gasAfter = gasleft();

    //         if (!hasBit(_allowFailureMap, uint8(i))) {
    //             // Check if the call failed.
    //             if (!success) {
    //                 revert ActionFailed(i);
    //             }
    //         } else {
    //             // Check if the call failed.
    //             if (!success) {

    //                 if (gasAfter < gasBefore / 64) {
    //                     revert InsufficientGas();
    //                 }

    //                 // Store that this action failed.
    //                 failureMap = flipBit(failureMap, uint8(i));
    //             }
    //         }
    //         execResults[i] = result;

    //     }
    //     emit Executed({
    //         actor: creator,
    //         actions: _actions,
    //         allowFailureMap: _allowFailureMap,
    //         failureMap: failureMap,
    //         execResults: execResults
    //     });
    // }

    function execute_actions(uint256 _allowFailureMap) public returns(bytes[] memory execResults, uint256 failureMap){

        execResults = new bytes[](actions.length);
        uint256 gasBefore;
        uint256 gasAfter;

        for(uint i = 0; i < actions.length; i++){

            gasBefore = gasleft();

            (bool success, bytes memory result) = actions[i].to.call{value: actions[i].value}(
                actions[i].data
            );

            gasAfter = gasleft();

            if (!hasBit(_allowFailureMap, uint8(i))) {
                // Check if the call failed.
                if (!success) {
                    revert ActionFailed(i);
                }
            } else {
                // Check if the call failed.
                if (!success) {

                    if (gasAfter < gasBefore / 64) {
                        revert InsufficientGas();
                    }

                    // Store that this action failed.
                    failureMap = flipBit(failureMap, uint8(i));
                }
            }
            execResults[i] = result;

        }
        emit Executed({
            actor: creator,
            actions: actions,
            allowFailureMap: _allowFailureMap,
            failureMap: failureMap,
            execResults: execResults
        });
    }

    function getAllActions() public view returns (Action[] memory) {
        return actions;
    }
}

